  "criminalCharges" : [ {
    "Charges" : "ORIGINALLY ARRESTED 2/16/73, IN COLFAX WASHINGTON FOR POSSESSION OF STOLEN PROPERTY, $50 FINE FOR NEGLIGENCE DRIVING AND WAIVER OF EXTRADITION TO NEZPERCE, IDAHO 2/20/73 FOR BURGLARY:  CHARGE WAS REDUCED TO PETTY LARCENY WITH A 90 DAY SUSPENDED SENTENCE & ORDERED TO LEAVE LEWIS COUNTY.  I HAD REMOVED OLD FURNITURE FROM AN ABANDONED FARM HOUSE,  THERE WERE NO DOORS OR WINDOWS IN HOUSE AND HAD BEEN ABANDONED AND EMPTY FOR YEARS,  THERE WAS NO OWNER TO PRESS CHARGES, ALL FURNITURE WAS RETURNED AND CHARGE WAS REDUCED.",
    "Disposition" : "PAID $50. FINE TO COLFAX, WASHINGTON FOR NEGLIGENT DRIVING CHARGE, 90 DAY SUSPENDED SENTENCE FROM NEZPERCE IDAHO.  CHARGE REDUCED TO PETTY LARCENY.  I WAS ARRESTED IN COLFAX, WASHINGTON ON THE BORDER OF WASHINGTON AND IDAHO.  THE PROPERTY WAS REMOVED IN IDAHO, SO THEY SENT ME BACK TO IDAHO.  THERE WAS NO ONE TO PRESS CHARGES AND ITEMS REMOVED WERE CONSIDERED WORTHLESS SO CHARGE WAS SUSPENDED IF I AGREED TO LEAVE LEWIS COUNTY AND IDAHO."
