  "Broker Comment" : "I HAD BEEN HIKING AND FISHING IN THE BACK COUNTRY AND CAME ACROSS AN ABANDONED, OLD STONE HOUSE ESTIMATED 100 YEARS OLD.  THERE WERE NO DOORS OR WINDOWS AND THE CONTENTS HAD BEEN OPEN TO THE ELEMENTS FOR YEARS.  IT WAS MY INTENT TO REFINISH SEVERAL OLD OAK PIECES OF FURNITURE FOR RESALE. I HAD LOADED THE PIECES ON TOP OF MY CAR AND WAS DRIVING BACK TO THE SEATTLE AREA WHEN I WAS PULLED OVER IN COLFAX, WA.  WHEN I COULD NOT GIVE THE OFFICER A REASON FOR HAVING THE FURNITURE HE ARRESTED ME.  I TOLD THEM WHAT, I HAD DONE AND THEY SENT ME BACK TO NEZPERCE, IDAHO NEAR WHERE I REMOVED THE ITEMS. I MADE A TERRIBLE MISTAKE."
